import React from 'react';
import styles from './Cake.module.css';

function Cake(props) {
  const array = ['y890', '055504', 340540, 405054];
  let image = [
    'https://sebweo.com/wp-content/uploads/2019/06/landshaft-bernskikh-alp-v-yasniy-den_thumb.jpg',
    'https://sebweo.com/wp-content/uploads/2019/06/landshaft-bernskikh-alp-v-yasniy-den_thumb.jpg',
    'https://sebweo.com/wp-content/uploads/2019/06/landshaft-bernskikh-alp-v-yasniy-den_thumb.jpg',
    'https://sebweo.com/wp-content/uploads/2019/06/landshaft-bernskikh-alp-v-yasniy-den_thumb.jpg',
    'https://sebweo.com/wp-content/uploads/2019/06/landshaft-bernskikh-alp-v-yasniy-den_thumb.jpg',
  ];
  return (
    <div>
      {array.map((item) => (
        <div>{item}</div>
      ))}
    </div>
  );
}
export default Cake;
